        >
            <Link href={'/index'}><a style={{ fontSize: "20px", color: "black"}}>Home</a></Link>
            <Link href={'/details'}><a style={{ fontSize: "20px", color: "black"}}>Skill Details</a></Link>
            <Link href={`/add`}><a>Add a Skill<a></a></a></Link>
        </nav>

    )
};

export default Nav;
